    content:"jsssssss"
  }
];
  const blog = () => {
    blogs.map((blog) => {
      <div className="p-5 d-flex align-items-center justify-content-between">
        <div>
          <h2>{blog.title}</h2>
          <p>{blog.content}</p>
        </div>
        <div>

